INSERT INTO public.courses_course (id, title, description, duration, price, courseImage, courseType, what_you_will_learn, slug, instructor_id, category, level, created_at, requirements)
VALUES
(1, 'Data Science & AI', 'Acquire advanced data skills, master Machine Learning & AI, and launch your career as a Data Scientist, Analyst, AI Engineer, Data Manager, and more.', 240, 199.99, 'courses/2025/05/28/data_science_ai.jpg', 'online', 'Master data analysis, machine learning, and AI techniques.', 'data-science-ai', 13, 'Data Science', 'Advanced', '2025-05-28 14:50:00+03', 'Basic programming and statistics knowledge'),
(2, 'Intro to generative AI', 'In just 30 hours, immerse yourself in the world of generative AI. Master effective prompt writing, boost productivity, and elevate your creativity and design skills. The subscription to ChatGPT Plus is strongly recommended for this course.', 30, 99.99, 'courses/2025/05/28/generative_ai.jpg', 'online', 'Learn prompt engineering and creative applications of AI.', 'intro-generative-ai', 13, 'AI', 'Intermediate', '2025-05-28 14:50:00+03', 'Basic computer skills, ChatGPT Plus recommended'),
(3, 'Intro to Python', 'Learn the basics of Python 3, one of the most powerful, versatile, and in-demand programming languages today.', 60, 79.99, 'courses/2025/05/28/python_intro.jpg', 'online', 'Understand Python syntax, data structures, and basic programming.', 'intro-python', 12, 'Programming', 'Beginner', '2025-05-28 14:50:00+03', 'No prior programming experience required'),
(4, 'Intro to SQL', 'Learn how to manage large datasets and analyze real data using the standard data management language.', 45, 69.99, 'courses/2025/05/28/sql_intro.jpg', 'online', 'Query databases and analyze data using SQL.', 'intro-sql', 16, 'Data Science', 'Beginner', '2025-05-28 14:50:00+03', 'Basic computer skills'),
(5, 'Launch your side project with Javascript', 'Master the fundamentals of Javascript, Chrome extension development, and WeChat Mini Programs creation.', 90, 129.99, 'courses/2025/05/28/javascript_side_project.jpg', 'online', 'Build Chrome extensions and WeChat Mini Programs.', 'javascript-side-project', 12, 'Programming', 'Intermediate', '2025-05-28 14:50:00+03', 'Basic Javascript knowledge'),
(6, 'Intro to No-code', 'Learn the basics of No-Code, a user-friendly way to build apps and websites without needing to know any programming languages. A fast-growing trend making technology creation accessible to everyone.', 30, 59.99, 'courses/2025/05/28/no_code_intro.jpg', 'online', 'Build apps and websites without coding.', 'intro-no-code', 11, 'No-Code', 'Beginner', '2025-05-28 14:50:00+03', 'No prior experience required'),
(7, 'Intro to UI/UX design', 'Embark on a journey into the heart of UI/UX design, a crucial, evolving, and in-demand discipline that shapes the user-centric digital world of today.', 60, 89.99, 'courses/2025/05/28/ui_ux_design.jpg', 'online', 'Learn UI/UX principles and design user-friendly interfaces.', 'intro-ui-ux-design', 11, 'Design', 'Beginner', '2025-05-28 14:50:00+03', 'Basic design interest'),
(8, 'Intro to Artificial Intelligence', 'Artificial Intelligence is an innovative and versatile field that enables machines to mimic human intelligence. It''s applicable in numerous sectors like healthcare, finance, and entertainment, significantly impacting how we live and work.', 90, 99.99, 'courses/2025/05/28/ai_intro.jpg', 'online', 'Understand AI concepts and applications across industries.', 'intro-artificial-intelligence', 13, 'AI', 'Beginner', '2025-05-28 14:50:00+03', 'Basic computer skills'),
(9, 'Intro to Git & GitHub', 'Explore the essentials of Git & GitHub, integral tools for efficient version management and team collaboration in contemporary software development.', 45, 69.99, 'courses/2025/05/28/git_github_intro.jpg', 'online', 'Master version control and collaboration with Git and GitHub.', 'intro-git-github', 15, 'Programming', 'Beginner', '2025-05-28 14:50:00+03', 'Basic computer skills'),
(10, 'Scrape the web with Python', 'Dive into the basics of web scraping and harness the power of Python to extract, process, and analyze data from the web.', 60, 89.99, 'courses/2025/05/28/web_scraping_python.jpg', 'online', 'Learn web scraping techniques using Python.', 'scrape-web-python', 13, 'Data Science', 'Intermediate', '2025-05-28 14:50:00+03', 'Basic Python knowledge'),
(11, 'Intro to Docker', 'Docker is a powerful platform that facilitates building, deploying, and managing containerized applications. Its versatility extends to microservices, continuous integration/delivery, and cloud computing.', 60, 99.99, 'courses/2025/05/28/docker_intro.jpg', 'online', 'Understand containerization and deploy applications with Docker.', 'intro-docker', 15, 'DevOps', 'Intermediate', '2025-05-28 14:50:00+03', 'Basic programming or system administration knowledge'),
(12, 'Intro to GA4', 'Discover how to navigate extensive datasets and interpret genuine insights using the premier tracking tool, Google Analytics 4 (GA4).', 45, 79.99, 'courses/2025/05/28/ga4_intro.jpg', 'online', 'Learn to analyze data with Google Analytics 4.', 'intro-ga4', 16, 'Data Analytics', 'Beginner', '2025-05-28 14:50:00+03', 'Basic computer skills'),
(13, 'Engaging Meta ads with AI', 'Create effective Meta ads with AI tools like ChatGPT, Canva, and DALL-E by learning AI prompting, target personas, ad formats, and copywriting to design high-performing ads.', 60, 99.99, 'courses/2025/05/28/meta_ads_ai.jpg', 'online', 'Design AI-driven Meta ads with high engagement.', 'meta-ads-ai', 17, 'Marketing', 'Intermediate', '2025-05-28 14:50:00+03', 'Basic marketing knowledge'),
(14, 'Intro to AI-driven SEO', 'Learn how AI tools like ChatGPT can enhance your content creation. From SEO optimization to practical tips, gain the skills to create engaging, high-ranking content that drives results.', 45, 89.99, 'courses/2025/05/28/ai_seo_intro.jpg', 'online', 'Optimize content for SEO using AI tools.', 'intro-ai-driven-seo', 17, 'Marketing', 'Beginner', '2025-05-28 14:50:00+03', 'Basic content creation knowledge');
